import React from 'react';
import { slide as Menu } from 'react-burger-menu';
import baruch1 from './Carousels-images/baruch1.jpg';
import {Button,Container} from 'react-bootstrap';
import Image from 'react-bootstrap/Image'
import{Link} from 'react-router-dom';
import app from "./base";


export default props => {
  return (

    <Menu>

      <a className="menu-item expand" href="https://drive.google.com/open?id=1L5wEed1K46xujnURX8a9v2kbRGhaxFRv" target="_blank">
        Team
      </a>
      <hr/>

      <a className="menu-item expand" href="https://github.com/ew0n/cis-5800" target="_blank">
        Github
      </a>
      <hr/>

      <a className="menu-item expand" href="https://www.baruch.cuny.edu" target="_blank">
        Baruch
      </a>
      <hr/>
      <a className="menu-item expand" href="https://library.baruch.cuny.edu/" target="_blank">
        Library
      </a>
      <hr/>
      <a className="menu-item expand" href="https://www.baruch.cuny.edu/bctc/helpdesk/" target="_blank">
        Help Desk
      </a>
      <hr/>
      <a className="expand" eventKey={2} componentClass={Link} href="/Homepage" to="/">Homepage</a>

    </Menu>

  );
};
